est\n  Scenario: Check that \u0027Gift Cards\u0027 tab is functional using title and text\n    When I click on Gift Cards tab\n    Then I verify Gift Cards tab with with title \u0027Amazon.com Gift Cards\u0027\n    And I verify Gift Cards with \u0027Hello. What can we help you with?\u0027 text\n\n  @HomeTest @SmokeTest\n  Scenario: Check that \u0027Registry\u0027 tab is functional using title\n    When I click on Registry tab\n    Then I verify Registry tab with with title \u0027Amazon.com: : Registry\u0027\n\n  @HomeTest @SmokeTest\n  Scenario: Check that \u0027Sell\u0027 tab is functional using title\n    When I click on Sell tab\n    Then I verify Sell tab with with title \u0027Amazon.com: Sell Products Online with Selling on Amazon.\u0027\n    And I verify Sell tab with \u0027Become an Amazon seller\u0027 text\n\n  @HomeTest @SmokeTest\n  Scenario: Check that \u0027Music\u0027 link is functional using URL and title\n    When I click on Music link\n    Then I verify Music link with with URL \u0027https://music.amazon.com/home?ref\u003ddm_aff_amz_com\u0027\n    And I verify Music link with title \u0027Amazon Music Unlimited - Stream 60 million songs online now.\u0027\n\n  @HomeTest @SmokeTest\n  Scenario: Check that \u0027Advertise Your Product\u0027 link is functional using title, URL, and text\n    When I click on Advertise Your Product link\n    Then I verify Advertise Your Product link with title \u0027Amazon Advertising: Online advertising on Amazon\u0027\n    And I verify Advertise Your Product link with URL \u0027https://advertising.amazon.com/\u0027\n    And I verify Advertise Your Product link with text \u0027Amazon Music Unlimited - Stream 60 million songs online now.\u0027\n\n  @HomeTest @SmokeTest\n  Scenario: Check that user can navigate to \u0027Computers \u0026 Tablets\u0027 page using \u0027Shop By Category\u0027 burger button\n    When I click on Shop By Category burger button\n    And I click on Computers\n    And I click on Computers \u0026 Tablets\n    Then I verify Computers \u0026 Tablets page with ASUS on \u0027Featured Brand\u0027 selection\n\n  @HomeTest @SmokeTest\n  Scenario: Check that user can navigate to \u0027Computers \u0026 Tablets\u0027 page and select \u0027HP\u0027 from \u0027Featured Brands\u0027 selection.\n    When I click on Shop By Category burger button\n    And I click on Computers\n    And I click on Computers \u0026 Tablets\n    And I click on HP checkbox from Featured Brands selection\n    Then I verify that HP checkbox is selected.","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Home.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon homepage functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"bf2ab99c-16f8-4e3a-bde3-f07f0fb5498f"}],"id":"0820e878-aed8-4289-b0c1-678e4b10a266"}},{"scenario":{"location":{"line":7,"column":3},"tags":[{"location":{"line":6,"column":3},"name":"@HomeTest","id":"0716639f-845a-4230-80d2-4b084faec435"},{"location":{"line":6,"column":13},"name":"@SmokeTest","id":"0a214bd6-22a4-47e3-95f8-a134eed9d855"}],"keyword":"Scenario","name":"Check that Amazon homepage loads using title","steps":[{"location":{"line":8,"column":5},"keyword":"Then ","text":"I verify Amazon homepage with title","id":"27ac74b4-2a28-43ed-873f-ab64e8015236"}],"id":"7e9e8acd-cae1-45e0-8341-47df4aed8e07"}},{"scenario":{"location":{"line":11,"column":3},"tags":[{"location":{"line":10,"column":3},"name":"@HomeTest","id":"a09330fd-229a-41db-a637-59ea0d2a0491"},{"location":{"line":10,"column":13},"name":"@SmokeTest","id":"8775fc26-7d4b-43c9-8f0e-caeedf9e0b62"}],"keyword":"Scenario","name":"Check that \u0027Today\u0027s Deal\u0027 tab is functional using title","steps" deIds":["01d6939c-22a9-4d02-88d3-eb116ffbf925"]}},{"pickle":{"id":"20cd5d16-3011-4db6-8ecb-986749fe5512","uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Home.feature","name":"Check that user can navigate to \u0027Computers \u0026 Tablets\u0027 page and select \u0027HP\u0027 from \u0027Featured Brands\u0027 selection.","language":"en","steps":[{"text":"I am on Amazon homepage","id":"ee641670-cf6d-4846-ac92-44d9418c441f","astNodeIds":["bf2ab99c-16f8-4e3a-bde3-f07f0fb5498f"]},{"text":"I click on Shop By Category burger button","id":"8c703a51-70e1-490b-90fc-65f2074b763d","astNodeIds":["810606c8-444f-45c4-9a84-a67fd7ab5857"]},{"text":"I click on Computers","id":"b5325d18-6eeb-4b61-a628-b4a91f2f0d36","astNodeIds":["f6cd421d-771a-4a42-8574-dff530c20baf"]},{"text":"I click on Computers \u0026 Tablets","id":"cc6c79dd-0df7-472b-a278-4878d582b99f","astNodeIds":["fa3ce669-001e-402f-a42a-7b3fe876e735"]},{"text":"I click on HP checkbox from Featured Brands selection","id":"e6b5dce2-3fe6-47cd-b99b-fa536017229b","astNodeIds":["a7cb6e9c-2032-4518-a0bc-9d5248945e96"]},{"text":"I verify that HP checkbox is selected.","id":"0e801a86-5e1a-47b5-88d2-aad50238b31b","astNodeIds":["a57d7845-e899-4e5f-be19-189c023e298b"]}],"tags":[{"name":"@HomeTest","astNodeId":"e98b245f-a711-4b15-b4d3-3bad9da1c87e"},{"name":"@SmokeTest","astNodeId":"bbce807a-ce28-4480-9e49-acf4b3b332e9"}],"astNodeIds":["1710edae-c6de-4231-9a9a-1b1b07c1a930"]}},{"source":{"uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Registration.feature","data":"Feature: Amazon Registration functionality check\n\n  Background:\n    Given I am on Amazon homepage\n    When I hover over \u0027Hello, Sign in\u0027 button\n    And I click on \u0027Start here\u0027 link on homepage\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that user can navigate to the Registration page using title\n    Then I verify page \"\u003ctitle\u003e\"\n    Examples:\n      | title               |\n      | Amazon Registration |\n\n  @Registration @SmokeTest\n  Scenario: Check that if user does not provide a name when registering, an alert message\n  \"Enter your name\" will be displayed\n    And I enter a random email address in the \u0027Email\u0027 field\n    And I enter a random password in the \u0027Password\u0027 field\n    And I Re-enter the password in the `Re-enter password` field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \u0027Enter your name\u0027 alert is displayed under `Your name` field\n\n  @Registration @SmokeTest\n  Scenario: Check that if user does not provide a email when registering, an alert message\n  \"Enter your email\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter a random password in the \u0027Password\u0027 field\n    And I Re-enter the password in the `Re-enter password` field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \u0027Enter your email\u0027 alert is displayed under `Email` field\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that if user does not provide a valid email format when registering, an alert message\n  \"Enter your email\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter an \"\u003cinvalid email\u003e\" address in the `Email` field\n    And I enter a random password in the \u0027Password\u0027 field\n    And I Re-enter the password in the `Re-enter password` field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \"\u003calert\u003e\" is displayed under `Email` field\n    Examples:\n      | alert                       | invalid email  |\n      | Enter a valid email address | invalid@email. |\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that if user does not provide a password when registering, an alert message\n  \"Enter your password\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter a random email address in the \u0027Email\u0027 field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \"\u003calert\u003e\" is displayed under `Password` field\n    Examples:\n      | alert               |\n      | Enter your password |\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that if user does not re-enter a password when registering, an alert message\n  \"Type your password again\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter a random email address in the \u0027Email\u0027 field\n    And I enter a random password in the \u0027Password\u0027 field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \"\u003calert\u003e\" is displayed under `Re-Enter password` field\n    Examples:\n      | alert                    |\n      | Type your password again |\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that if user does not provide a password that is at least 6 characters long\n  when registering, two alert messages \"Passwords must be at least 6 characters.\" and\n  \"Type your password again\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter a random email address in the \u0027Email\u0027 field\n    And I enter a random five character long password in the \u0027Password\u0027 field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \"\u003cPassword alert\u003e\" is displayed under `Password` field for not meeting the password criteria\n    And I verify \"\u003cRe-enter password alert\u003e\" is displayed under `Re-Enter password` field\n    Examples:\n      | Password alert                           | Re-enter password alert  |\n      | Passwords must be at least 6 characters. | Type your password again |\n\n  @Registration @SmokeTest\n  Scenario Outline: Check that if user tries to register with an email that already has been used to create an\n  account previously, an alert message \"Email address already in use\" will be displayed\n    And I enter a random \u0027name\u0027\n    And I enter an \"\u003cemail\u003e\" address that\u0027s already in use in the \u0027Email\u0027 field\n    And I enter a random password in the \u0027Password\u0027 field\n    And I Re-enter the password in the `Re-enter password` field\n    And I click on \u0027Create you Amazon account\u0027 button on the Registration page\n    Then I verify \"\u003calert\u003e\" is displayed for proving an email address that\u0027s already in use\n    Examples:\n      | email                    | alert                        |\n      | ciara105@xhanimatedm.com | Email address already in use |\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/Registration.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon Registration functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"f9c95ff0-6a23-49e5-8860-71411011610f"},{"location":{"line":5,"column":5},"keyword":"When ","text":"I hover over \u0027Hello, Sign in\u0027 button","id":"0b0551f3-989d-42ae-8d66-16411fbb5f13"},{"location":{"line":6,"column":5},"keyword":"And ","text":"I click on \u0027Start here\u0027 link on homepage","id":"577824fb-d369-4063-a0b4-fd89cc22e523"}],"id":"346fff8e-9e14-43de-9830-dd435a3a484e"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@Registration","id":"addcd9bf-40e4-4ce0-b26d-e7bcdc6ba856"},{"location":{"line":8,"column":17},"na ework_Team1/Amazon/src/test/java/features/Search.feature","name":"Amazon \u0027All\u0027 dropdown search functionality check by selecting each department and validating","language":"en","steps":[{"text":"I am on Amazon homepage","id":"cdbb0ced-a2e7-48ca-9f9c-a17637b46da6","astNodeIds":["3df3b7c9-d501-41bc-a3eb-dd222263382e"]},{"text":"I select \"Computers\" from \u0027All\u0027 dropdown","id":"f4e26e97-edf4-407b-b5eb-ec90b5df126f","astNodeIds":["346309d9-09e4-4db6-a38d-d535018dae83","11c9c48e-7c91-43fd-84eb-11b651973a07"]},{"text":"I submit search field","id":"37ec6ed9-ba68-468d-8788-fa41be1c77a6","astNodeIds":["64fbe704-83ac-483f-a434-5cef5579e246","11c9c48e-7c91-43fd-84eb-11b651973a07"]},{"text":"I verify that I am in \u0027Computers\u0027 department with \"Computers, Tablets and IT Accessories\".","id":"5345f956-6e4e-4468-af9a-da1772b2bd09","astNodeIds":["2c4f17f8-913c-407b-b5a9-2080fd328455","11c9c48e-7c91-43fd-84eb-11b651973a07"]}],"tags":[{"name":"@SearchTest","astNodeId":"b7ca9de2-0393-45d5-ba1a-c505edeba402"},{"name":"@SmokeTest","astNodeId":"512c1c15-a227-4aea-86f0-446e80d76a2e"},{"name":"@MyTest","astNodeId":"9e0c8b08-07bf-4455-a482-c377da944ed0"}],"astNodeIds":["3d93abfb-e7a3-4b42-8208-e30dacb46433","11c9c48e-7c91-43fd-84eb-11b651973a07"]}},{"source":{"uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/SignIn.feature","data":"Feature: Amazon Sign In functionality check\n\n  Background:\n    Given I am on Amazon homepage\n    When I hover over \u0027Hello, Sign in\u0027 button\n    And I click on \u0027Sign in\u0027 button under Hello, Sign in\n\n  @SignInTest @SmokeTest\n  Scenario: Check that user can navigate from homepage to Sign In page using title\n    Then I verify page title as \"Amazon Sign-In\"\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid email\n    And I enter an invalid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    Then I verify that the \"\u003calert message\u003e\" is displayed\n    Examples:\n      | email address                 | alert message                                     |\n      | invalidEmail@invalidEmail.com | We cannot find an account with that email address |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid phone number\n    And I enter an invalid \"\u003cphone number\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    Then I verify that the \"\u003calert message\u003e\" is displayed\n    Examples:\n      | phone number | alert message                                     |\n      | 8399283899   | We cannot find an account with that mobile number |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an alert message is displayed when user tries to login with an invalid password\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I enter an invalid \"\u003cpassword\u003e\" on the \u0027Password\u0027 field\n    And I click on \u0027Sign-in\u0027 button after password\n    Then I verify that the \"\u003calert message1\u003e\" or \"\u003calert message2\u003e\" is displayed\n    Examples:\n      | email address            | password        | alert message1             | alert message2                                                                                                                    |\n      | ciara105@xhanimatedm.com | InvalidPass123! | Your password is incorrect | To better protect your account, please re-enter your password and then enter the characters as they are shown in the image below. |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an user can successfully log into Amazon\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I enter a valid \"\u003cpassword\u003e\" on the Password field\n    And I click on \u0027Sign-in\u0027 button after password\n    Then I verify that \"\u003cuser\u0027s name\u003e\" is displayed\n    Examples:\n      | email address               | password   | user\u0027s name |\n      | shakir.jahangir83@gmail.com | BugBusters | Shakir      |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that two users can successfully log into Amazon consecutively\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I enter a valid \"\u003cpassword\u003e\" on the Password field\n    And I click on \u0027Sign-in\u0027 button after password\n    Then I verify that \"\u003cuser\u0027s name\u003e\" is displayed\n    Examples:\n      | email address               | password   | user\u0027s name |\n      | shakir.jahangir83@gmail.com | BugBusters | Shakir      |\n      | zarria@xhanimatedm.com      | BugBusters | Phong       |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an alert message is displayed when user tries to login without an email or phone number\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    Then I verify that the missing email or phone \"\u003calert message\u003e\" is displayed\n    Examples:\n      | alert message                           |\n      | Enter your email or mobile phone number |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that an alert message is displayed when user tries to login without a password\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Sign-in\u0027 button after password\n    Then I verify that the missing password \"\u003calert message\u003e\" is displayed\n    Examples:\n      | email address               | alert message       |\n      | shakir.jahangir83@gmail.com | Enter your password |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that user can navigate to \u0027Forgot your password?\u0027 page\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Forgot your password?\u0027 link\n    Then I verify \"\u003cpage title\u003e\"\n    Examples:\n      | email address               | page title                 |\n      | shakir.jahangir83@gmail.com | Amazon Password Assistance |\n\n  @SignInTest @SmokeTest\n  Scenario Outline: Check that alert message is displayed when user can navigate to \u0027Forgot your password?\u0027 page\n  and enter invalid email address\n    And I enter a valid \"\u003cemail address\u003e\" on \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Continue\u0027 button below \u0027Email (phone for mobile accounts) field\n    And I click on \u0027Forgot your password?\u0027 link\n    And I clear the \u0027Email or mobile phone number\u0027 field\n    And I enter an \"\u003cinvalid email address\u003e\" on Forgot your password? page\n    And I click on \u0027Continue\u0027 button on \u0027Forgot your password?\u0027 page\n    Then I verify by \"\u003ccaptcha\u003e\" or an \"\u003calert text\u003e\"\n    Examples:\n      | email address               | invalid email address    | captcha                                                  | alert text                                                                   |\n      | shakir.jahangir83@gmail.com | bogusemail9183@bogus.com | Please solve this puzzle so we know you\u0027re a real person | We\u0027re sorry. We weren\u0027t able to identify you given the information provided. |\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/ramdaneameur/IdeaProjects/BDDWebAutomationFramework_Team1/Amazon/src/test/java/features/SignIn.feature","feature":{"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Amazon Sign In functionality check","children":[{"background":{"location":{"line":3,"column":3},"keyword":"Background","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","text":"I am on Amazon homepage","id":"4a226e8f-eb66-4eb8-bdbf-f6b9b242c4f0"},{"location":{"line":5,"column":5},"keyword":"When ","text":"I hover over \u0027Hello, Sign in\u0027 button","id":"e89a9cac-9d9d-43ec-8303-6339e277e311"},{"location":{"line":6,"column":5},"keyword":"And ","text":"I click on \u0027Sign in\u0027 button under Hello, Sign in","id":"848bb44c-5508-4490-b1ed-427a86566111"}],"id":"61164693-1fe4-4bf3-abde-b94d9c0c85cb"}},{"scenario":{"location":{"line":9,"column":3},"tags":[{"location":{"line":8,"column":3},"name":"@SignInTest","id":"e044d031-c67b-4811-a647-8efd624d3a3d"},{"location":{"line":8,"column":15},"name":"@SmokeTest","id":"96e867bd-fffb-496f-a608-54e256d27642"}],"keyword":"Scenario","name":"Check that user can navigate from homepage to Sign In page using title","steps":[{"location":{"line":10,"column":5},"keyword":"Then ","text":"I verify page title as \"Amazon Sign-In\"","id":"4cd17ffd-1e26-4cd0-892e-322d7cd9ba2a"}],"id":"f50dc0f5-3da9-4efb-a0cb-72ba94b3bbea"}},{"scenario":{"location":{"line":13,"column":3},"tags":[{"location":{"line":12,"column":3},"name":"@SignInTest","id":"e73f5f09-12f4-44c6-96d8-84f4d8700797"},{"location":{"line":12,"column":15},"name":"@Smo
